import {createRouter, createWebHashHistory} from "vue-router";
import signup from "./components/signup"
import login from "./components/main"

const router = createRouter({
    history: createWebHashHistory(),
    routes:[
        {
            path:"/signup",
            name:"signup",
            component: signup
        },
        {
            path:"/login",
            name:"login",
            component: login
        },
    ]
});

export default router;
